            <text id="About_me" data-name="About me" transform="translate(519 200.171)" font-size="60" font-family="BebasNeue-Regular, Bebas Neue"><tspan x="0" y="0">About me</tspan></text>
            <text id="I_am_Luca_Megens_born_at_the_ripe_age_of_0_on_26th_of_August_2002._All_jokes_aside_I_m_a_young_FHICT_media_design_and_creative_technology_bachelor_student_specialized_in_creative_thinking_media_design_and_web_development._I_m_very_ambitious_and_I_m_very" data-name="I am Luca Megens born at the ripe age of 0 on 26th of August 2002.
          All jokes aside, I&apos;m a young FHICT media design and creative technology bachelor student specialized in creative thinking, media design and web development. 
          I&apos;m very ambitious and I&apos;m very" transform="translate(519 239)" font-size="20" font-family="Bahnschrift"><tspan x="0" y="16">I am Luca Megens born at the ripe age of 0 on 26th of August 2002.</tspan><tspan x="0" y="54">All jokes aside, I&apos;m a young FHICT media design and creative technology </tspan><tspan x="0" y="82">bachelor student specialized in creative thinking, media design and web </tspan><tspan x="0" y="110">development. </tspan><tspan x="0" y="148">I&apos;m very ambitious and I&apos;m very eager to keep learning and exploring new </tspan><tspan x="0" y="176">ways. My specialities lies within my abilities to come up with creative and </tspan><tspan x="0" y="204">alternative ways to work on projects and to solve problems. I am not </tspan><tspan x="0" y="232">afraid to be thrown into the deep with regards to working on projects.</tspan><tspan x="0" y="270"></tspan><tspan x="0" y="308"></tspan></text>
